interface Cards {
	id: string;
	category: string;
	src: string;
	title: string;
	content: string;
	tags: Array<string>;
}

const CardContainer: React.FC = ({ id, category, src, title, content, tags }: Cards) => {
	const cardData = useSelector(
		(state: RootReducerType) => state.cardReducer
	);
